const Platforms = ({ selectedPlatforms, onChange }) => {
  return (
    <select name="platforms" onChange={onChange} value={selectedPlatforms} multiple>
      <option  selected disabled value="">Seleccionar plataforma</option>
      <option name="PlayStation" value="PlayStation">PlayStation</option>
      <option name="Xbox" value="Xbox">Xbox</option>
      <option name="PC" value="PC">PC</option>
      <option name="Web" value="Web">Web</option>
      <option name="Android" value="Android">Android</option>
      <option name="IOS" value="IOS">IOS</option>
      <option name="Apple Macintosh" value="Apple Macintosh">Apple Macintosh</option>
      <option name="Linux" value="Linux">Linux</option>
      <option name="Nintendo" value="Nintendo">Nintendo</option>
      <option name="Atari" value="Atari">Atari</option>
      <option name="SEGA" value="SEGA">SEGA</option>
      <option name="Commodore" value="Commodore">Commodore </option>
      <option name="Neo Geo" value="Neo Geo">Neo Geo</option>
      <option name="3DO" value="3DO">3DO</option>
    </select>
  );
};

export default Platforms;
